  `uid` bigint NOT NULL DEFAULT 0 COMMENT 'uuid',
  `facility_code` varchar(30) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL DEFAULT '' COMMENT '设施编号',
  `facility_type` tinyint NOT NULL DEFAULT 0 COMMENT '设施类型0.餐厨垃圾桶 1.中转垃圾箱',
  `weight` double NOT NULL DEFAULT 0 COMMENT '垃圾桶重量（单位：kg）',
  `capacity` int NOT NULL DEFAULT 0 COMMENT '容量 单位升',
  `reserve` int NOT NULL DEFAULT 0 COMMENT '当前垃圾储量,L',
  `address` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL DEFAULT '' COMMENT '详细地址',
  `rfid` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL COMMENT '垃圾桶rfid',
  `manufacturer` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NOT NULL COMMENT '生产厂家',
