  `restaurant_id` bigint NOT NULL DEFAULT 0 COMMENT '餐馆id',
  `longitude` double(10, 6) NOT NULL COMMENT '经度，肯定是存储数据精度越高，最终位置定位越准确。但是考虑到数据库资源以及可定位到精准性，根据谷歌官方的建议，存储经纬度的时候，使用double(10,6)就可以了。这样，这些字段将会存储小数点后 6 位数以及小数点前最多 4 位数，如 -153.456783 度',
  `latitude` double(10, 6) NOT NULL COMMENT '纬度',
  `creator` bigint NOT NULL DEFAULT 0 COMMENT '创建人id',
  `create_time` datetime(6) NOT NULL DEFAULT CURRENT_TIMESTAMP(6) COMMENT '创建时间',
  `disabled` tinyint NOT NULL DEFAULT 0 COMMENT '禁用状态',
  `disabled_by` bigint NOT NULL DEFAULT 0 COMMENT '禁用人id',
  `disabled_time` datetime(0) NOT NULL DEFAULT CURRENT_TIMESTAMP(0) COMMENT '禁用时间',
  `updator` bigint NOT NULL DEFAULT 0 COMMENT '修改者id',
  `update_time` datetime(0) NOT NULL DEFAULT CURRENT_TIMESTAMP(0) ON UPDATE CURRENT_TIMESTAMP(0) COMMENT '修改时间',
